import React, { useEffect, useState } from "react";

const CONFIG = {
  APP_ID: "1179716207111509",               // <-- your App ID
  API_VERSION: "v23.0",
  CONFIG_ID: "YOUR_EMBEDDED_SIGNUP_CONFIG_ID", // <-- from Dev Dashboard > Facebook Login for Business > Configurations
  BACKEND_URL: "http://localhost:8081",     // <-- your backend
  REDIRECT_URI: "http://localhost:8081/meta/wa/callback", // must exactly match dashboard
};

export default function App() {
  const [isSDKLoaded, setIsSDKLoaded] = useState(false);
  const [status, setStatus] = useState("idle"); // idle | loading | success | error
  const [message, setMessage] = useState("");
  const [businessInfo, setBusinessInfo] = useState(null);
  const [nextSteps, setNextSteps] = useState([]);

  // Load FB SDK and init
  useEffect(() => {
    if (!document.getElementById("facebook-jssdk")) {
      const js = document.createElement("script");
      js.id = "facebook-jssdk";
      js.src = "https://connect.facebook.net/en_US/sdk.js";
      document.body.appendChild(js);
    }

    window.fbAsyncInit = function () {
      window.FB.init({
        appId: CONFIG.APP_ID,
        cookie: true,
        xfbml: false, // not using <fb:login-button>
        version: CONFIG.API_VERSION,
      });
      setIsSDKLoaded(true);
    };

    // Listen to Embedded Signup postMessage events
    const messageListener = (event) => {
      const ok =
        typeof event.origin === "string" &&
        (event.origin.endsWith(".facebook.com") ||
          event.origin === "https://www.facebook.com" ||
          event.origin === "https://business.facebook.com");
      if (!ok) return;

      try {
        const data =
          typeof event.data === "string" ? JSON.parse(event.data) : event.data;
        if (data?.type === "WA_EMBEDDED_SIGNUP") {
          // Helpful logs during setup; contains FINISH events with waba_id/phone_number_id
          console.log("WA Embedded Signup event:", data);
        }
      } catch {
        /* ignore non-JSON */
      }
    };

    window.addEventListener("message", messageListener);
    return () => window.removeEventListener("message", messageListener);
  }, []);

  const startSignup = () => {
    if (!isSDKLoaded) {
      setMessage("Facebook SDK not ready. Please wait.");
      return;
    }

    setStatus("loading");
    setMessage("Opening WhatsApp Business signup...");

    window.FB.login(
      (response) => {
        // Expect an exchangeable "code" when using response_type:'code'
        const code = response?.authResponse?.code;
        if (code) {
          setupBusinessAccount(code);
        } else {
          setStatus("error");
          setMessage("Signup cancelled or failed.");
        }
      },
      {
        config_id: CONFIG.CONFIG_ID,            // REQUIRED for Embedded Signup
        response_type: "code",                  // REQUIRED to receive "code"
        override_default_response_type: true,   // REQUIRED
        // Optional extras if you want to pre-fill:
        // extras: {
        //   setup: { setup_type: "BOTH" } // or "NEW" / "EXISTING"
        // }
      }
    );
  };

  // Call your backend to exchange the code and finish setup
  const setupBusinessAccount = async (authCode) => {
    try {
      setMessage("Server is processing your WhatsApp Business setup...");

      const res = await fetch(`${CONFIG.BACKEND_URL}/api/whatsapp/setup`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          authorization_code: authCode,
          redirect_uri: CONFIG.REDIRECT_URI, // send for strict match on server
          client_info: {
            user_agent: navigator.userAgent,
          },
        }),
      });

      const result = await res.json();

      if (result.success) {
        setStatus("success");
        setMessage(result.message || "WhatsApp Business setup completed.");
        setBusinessInfo(result.business_info || null);
        setNextSteps(result.next_steps || []);
      } else {
        throw new Error(result.error || "Unknown setup error");
      }
    } catch (err) {
      setStatus("error");
      setMessage(`Setup failed: ${err.message}`);
    }
  };

  const reset = () => {
    setStatus("idle");
    setMessage("");
    setBusinessInfo(null);
    setNextSteps([]);
  };

  return (
    <div style={{ maxWidth: 720, margin: "40px auto", fontFamily: "system-ui, sans-serif" }}>
      <h1>üü¢ WhatsApp Business ‚Äì Embedded Signup</h1>
      <p style={{ color: "#555" }}>
        Click the button to connect your WhatsApp Business account. The server completes the setup.
      </p>

      {status === "idle" && (
        <>
          <button
            onClick={startSignup}
            disabled={!isSDKLoaded}
            style={{
              padding: "10px 16px",
              borderRadius: 8,
              border: "1px solid #ccc",
              cursor: isSDKLoaded ? "pointer" : "not-allowed",
            }}
          >
            {isSDKLoaded ? "üöÄ Connect WhatsApp Business" : "‚è≥ Loading Facebook SDK..."}
          </button>
          <div style={{ marginTop: 16, fontSize: 14, color: "#666" }}>
            <strong>Flow:</strong> Login ‚Üí Embedded Signup ‚Üí Code ‚Üí Server Exchange ‚Üí WABA/Phone setup.
          </div>
        </>
      )}

      {status === "loading" && (
        <div style={{ marginTop: 16 }}>
          <strong>Setting up your account‚Ä¶</strong>
          <p>{message}</p>
        </div>
      )}

      {status === "success" && (
        <div style={{ marginTop: 16 }}>
          <h3>‚úÖ Setup Complete</h3>
          <p>{message}</p>

          {businessInfo && (
            <div style={{ marginTop: 12, padding: 12, border: "1px solid #eee", borderRadius: 8 }}>
              <div><strong>Business Name:</strong> {businessInfo.business_name || "‚Äî"}</div>
              <div><strong>WABA ID:</strong> {businessInfo.waba_id || "‚Äî"}</div>
              <div><strong>Phone Numbers:</strong> {businessInfo.phone_numbers?.length ?? 0}</div>
              <div><strong>Webhooks:</strong> {businessInfo.webhooks_enabled ? "‚úÖ Enabled" : "‚ùå Disabled"}</div>
              <div><strong>Status:</strong> {businessInfo.setup_complete ? "‚úÖ Complete" : "‚è≥ In Progress"}</div>

              {(businessInfo.phone_numbers || []).map((p, i) => (
                <div key={p.id || i} style={{ marginTop: 12, paddingTop: 12, borderTop: "1px solid #f0f0f0" }}>
                  <strong>üì± Phone {i + 1}</strong>
                  <div><strong>Number:</strong> {p.phone_number}</div>
                  <div><strong>Display Name:</strong> {p.display_name}</div>
                  <div><strong>Verified:</strong> {p.is_verified ? "‚úÖ Yes" : "‚ùå No"}</div>
                  <div><strong>Quality:</strong> {p.quality_rating || "Unknown"}</div>
                </div>
              ))}
            </div>
          )}

          {nextSteps?.length > 0 && (
            <div style={{ marginTop: 16 }}>
              <h4>üéØ Next Steps</h4>
              <ul>{nextSteps.map((s, i) => <li key={i}>{s}</li>)}</ul>
            </div>
          )}

          <button onClick={reset} style={{ marginTop: 12, padding: "8px 12px", borderRadius: 8 }}>
            üîÑ Setup Another Account
          </button>
        </div>
      )}

      {status === "error" && (
        <div style={{ marginTop: 16 }}>
          <h3>‚ùå Setup Failed</h3>
          <p>{message}</p>
          <button onClick={reset} style={{ marginTop: 12, padding: "8px 12px", borderRadius: 8 }}>
            üîÑ Try Again
          </button>
        </div>
      )}
    </div>
  );
}
